<h2>Ensembl IDs from GTEx V6 Gene Read Count Data</h2>

<h3>Description</h3>

<p>A dataset containing the Ensembl IDs from GTEx (V6)
gene read count data.
</p>


<h3>Usage</h3>

<pre><code class="language-R">gtexv6
</code></pre>


<h3>Format</h3>

<p>A character vector with 56,318 Ensembl IDs.</p>


<h3>Source</h3>

<p><a href="https://www.gtexportal.org">https://www.gtexportal.org</a>
</p>
